- Chất liệu: Bìa da ngoại, ruột Fort kem ngoại 80g/m2 cao cấp, bám mực tốt, độ chống thấm cao, phù hợp với hầu hết các loại viết.
- Thiết kế:
+ Sản phẩm có dòng kẻ ngang giúp bạn viết chữ nhanh chóng và dễ dàng.
+ Bìa da ngoại sang trọng, kiểu dáng vừa vặn có thể dễ dàng mang theo khi học tập và làm việc.
+ Giấy trắng cao cấp, in 2 màu, không gây hại cho mắt
+ Thích hợp làm quà tặng', N'L000000004', 1)
